//UDF to Split Text at every 133 characters
 int n = 0;
int p = 0;
for(int i=0;i<a.length;i++)
          {
   n = 0;
   p = 0;
	if(a[i].length() < 134)
	result.addValue(a[i]);

                        else
	{

	       int c = a[i].length() / 133;
	       int r = a[i].length() % 133;
	       if(r == 0)
                                {
	        n = c;
                                 } 
	        else
                                {
	        n = c+1;
	         } 		
                                for(int j= 0;j<n;j++)
 		{
	                                   if (p < (a[i].length() - 133))
	 		{
		                                  result.addValue(a[i].substring(p,p + 133));
		                                  p = p + 133;
 			}
                                                            else
	                                                  result.addValue(a[i].substring(p,a[i].length()));

		}
	           }

      }

